import React from "react";

const Loginout = () => {
  return (
    <div>
      <a className="login" href="#">
        <i className="fa-solid fa-chevron-down"></i>
        <i className="fa-solid fa-user-large"></i>
      </a>
    </div>
  );
};

export default Loginout;
